import React from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";
import logo from "../resources/logo.svg";

function Navbar() {
	return (
		<Wrapper>
      <div className="navbar-left_bar">
        <div className="navbar-logo">
	        <img src={logo} alt="logo" />
        </div>

        <ul className="navbar_catalog">
          <li className="navbar_catalog-item">
		        <Link to="/" className="navbar_catalog-name">
              ГЛАВНАЯ
            </Link>
          </li>
          <li className="navbar_catalog-item">
            <Link to="/products/clothes" className="navbar_catalog-name">
              ОДЕЖДА
            </Link>
          </li>
	        <li className="navbar_catalog-item">
	          <Link to="/products/clothes/shoes" className="navbar_catalog-name">
	            ОБУВЬ
	          </Link>
	        </li>
          <li className="navbar_catalog-item">
            <Link to="/products/equipment" className="navbar_catalog-name">
              СНАРЯЖЕНИЕ
            </Link>
          </li>
          <li className="navbar_catalog-item">
            <Link to="/products/accessories" className="navbar_catalog-name">
              АКСЕССУАРЫ
            </Link>
          </li>
          <li className="navbar_catalog-item">
            <Link to="/products/run" className="navbar_catalog-name">
              БЕГ
            </Link>
          </li>
					<li className="navbar_catalog-item">
						<Link to="/contacts" className="navbar_catalog-name">
							КОНТАКТЫ
				    </Link>
          </li>
				</ul>
			</div>

			<div className='navbar-right_bar'>
			</div>
		</Wrapper>
	);
}

const Wrapper = styled.nav`
	// position: fixed;
	display: flex;
  justify-content: space-between;
	align-items: center;
	height: 5rem;
	background: var(--clr-white);
	z-index: 2;

	.navbar_catalog {
		display: flex;
    align-items: center;
	}

  .left-container {
    display: flex;
    align-items: center;
    height: 100%;
  }
`;

export default Navbar;
